import React from 'react';
import manishPhoto from '../images/photo.jpg';

const About = () => {
	
    var width = window.innerWidth;
	var height = window.innerHeight;

    return (
		<div className="App-header">
            <header>
				<br/>
				<div className='about-container'>
					<div className='image'>
						<img alt="Manish" src={manishPhoto} width={width/8} height={height/8}/>
					</div>
					<div className='text'>
						<p>
							My name is Manish Mallik, and I am a computer science major at the University of Texas at 
							Dallas! I am currently a Software Engineer Intern at JPMorgan Chase & Co. I am also the 
							Corporate Relations officer of the User Experience club at UTD. {<br/>}I have also been a
							mentor at the computer science mentor center.
						</p>
					</div>
				</div>
			</header>
			<br/>
			<br/>
			<div>
				<p>Here are my hobbies when I am not programming or doing anything computer science related.</p>
			</div>

        </div>
	);
};

export default About;
